import React from "react";
import { Accordion } from "react-bootstrap";
import Task from "./Task";

const Category = (props) =>{
    return(
        <Accordion defaultActiveKey="0">
            {Object.values(props.data).map((category, index)=>{
                return <Accordion.Item key={index} eventKey={index}>
                            <Accordion.Header>{ category === "any" ? "Задачи без категории" : category}</Accordion.Header>
                            <Accordion.Body>
                                {Object.values(props.data[category]).map((task, index) => {
                                    <Task key={index} item={task} done={props.data[category][task]} />
                                })}
                            </Accordion.Body>
                        </Accordion.Item>
            })}
            <Accordion.Item eventKey="0">
                <Accordion.Header>Accordion Item #1</Accordion.Header>
                <Accordion.Body>
                    <Task />
                </Accordion.Body>
            </Accordion.Item>
        </Accordion>
    )
}

export default Category;
